    renderHangmanImage = ()=> {
        switch (props.gameTurn) {
            case 6:
                return <img src="../assets/man1.png"/>
            case 5:
                return <img src="../assets/man2.png"/>
            case 4:
                return <img src="../assets/man3.png"/>
            case 3:
                return <img src="../assets/man4.png"/>
            case 2:
                return <img src="../assets/man5.png"/>
            case 1:
                return <img src="../assets/man6.png"/>
            default:
                return 
        }
    }
    return (
        <div>
            {this.renderHangmanImage()}
        </div>
    )
}
